import React, { Component } from 'react';
import DataTablePage from './DataTablePage';

export class AccountDetails extends Component {
  render() {
    return (
      <div>
        <h2>Transactions history</h2><br/>
        <div className="text-dark m-auto table-hover table-responsive table-sm text-left">
          <DataTablePage />
        </div>
        <div className="card">
          <div className="card-header bg-dark text-white">
            Date: April 14, 2019 <span>&nbsp;&nbsp;</span>
            <button className='btn btn-secondary btn-sm float-right'>
              <i className='fas fa-plus'>&nbsp;&nbsp;</i>Add
            </button>
          </div>

          <div className="card-body text-dark m-auto table-hover table-responsive table-sm text-left">
            <DataTablePage/>
          </div>

          <div className="card-footer text-dark">
            Current balance: $5,000
          </div>
        </div>
      </div>
    )
  }
}

export default AccountDetails;
